Put our products to the test, exploit their great features and cook an unlimited number of menus!

The De’Longhi Recipe Book is the new, free App - for smartphones and tablets - collecting all the recipes for your De’Longhi cooking appliances. 
The De’Longhi Recipe Book is a complete cooking tool:
● a large, and always increasing, number of recipes;
● easy-to-use, can be taken everywhere;
● with recipes from all over the world;
● all recipes tested by a chef;
● eat better with direct control on calories;
● share your cooking experience with your friends through social networks;
● save your Favourites in the dedicated area.

Доставка Даниловского — это сервис доставки свежих продуктов и готовых блюд с Даниловского рынка.

Круглый год мы развозим заказы по Москве и Московской области. В каталоге Доставки Даниловского свыше 500 готовых блюд из любимых кафе и более 2000 свежих продуктов. 

Грузинские хинкали и вьетнамский фо, австралийские пироги и фалафель, фермерские сыры и экзотические фрукты, ремесленный мёд и бабушкины соленья — всё это и даже больше в приложении Доставки Даниловского рынка. 

Также через приложение вы сможете заказать подарочные корзины, цветы, товары для дома, строительства и ремонта, бытовую химию и многое другое. 

Как сделать заказ?
— Зарегистрируйтесь в приложении, используя свой номер телефона; 
— Добавьте продукты или блюда в корзину; 
— Введите адрес и выберите удобный временной интервал для доставки; 
— Оформите заказ и оплатите его банковской картой в приложении.
